    if nums[0] < 0: nums[0], neg = -1 * nums[0], -1 + nums[0]
    nums = [int(i) for i in str(abs(nums[0]))]
    nums[0] = nums[0] * neg
    return sorted(nums, key=lambda x: sum(int(digit) for digit in str(x)))

