def Strongest_Extension(extensions, class_name):
    strong = extensions[0]
    my_val = sum(1 for x in strong if x.isalpha() and x.isupper()) - sum(1 for x in strong if x.isalpha() and x.islower())
    for s in extensions:
        val = sum(1 for x in s if x.isalpha() and x.isupper()) - sum(1 for x in s if x.isalpha() and x.islower())
        if val > my_val:
            strong = s
            my_val = val

    ans = class_name + strong
    return ans

